webpackJsonp([0xb646d0efca71],{379:function(n,e){n.exports={data:{markdownRemark:{html:"<p> <strong>WHEREAS</strong> </p>\n<ul>\n<li>\n<p>an educated labour force is critical for economic development, developing new industries, and creating jobs;</p>\n</li>\n<li>\n<p>many rural regions of Canada face a shortage of educated labourers in necessary sectors;</p>\n</li>\n<li>\n<p>diversification of industries and sources of employment is important for sustainable economic growth, particularly in rural regions;</p>\n</li>\n<li>\n<p>such diverse industries and sources of employment require specialized skills</p>\n</li>\n</ul>\n<p><strong>BE IT RESOLVED</strong> the Liberal Party of Canada call on the Government of Canada to: </p>\n<ul>\n<li>\n<p>identify potential industries for economicdiversification and identify labour needs for those industries;</p>\n</li>\n<li>\n<p>increase support for post-secondary education in areas of identified labour needs(Newfoundland and Labrador)</p>\n</li>\n</ul>",frontmatter:{path:"/policy/post-secondary-funding-and-economic-development",date:"Tue Mar 06 2018 00:08:44 GMT-0500 (EST)",title:"Post-Secondary Funding and Economic Development"}}},pathContext:{}}}});
